import React from "react";
function F() {
    const[name, setName]=React.useState("");
    return (
      <div className="F">
        <h1>{name}</h1>
        <form>
          <p>
            <label>Имя </label>
            <input type="text" onChange={(e) => setName(e)}></input>
          </p>
          <p>
            <label>Почта </label>
            <input type="text"></input>
          </p>
          <p>
            <label>Пароль </label>
            <input type="password"></input>
          </p>
          <input type="submit" value="Зарегистрироваться"/>
        </form>
      </div>
    );
  }
    
    export default F;
